.rankList-box-body {
  margin: 0 10px;
  height: 100%;
  >>> .el-table tr:last-child td {
    border-bottom: unset;
  }
  .rank-box {
    .rank-box-span {
      display: inline-block;
      width: 24px;
      height: 24px;
      line-height: 24px;
      text-align: center;
      background-color: rgba(24, 144, 255, 0.39);
      border-radius: 50%;
      color: #fff;
      opacity: 0.3;
    }
    img {
      width: 35px;
      height: 35px;
    }
  }
  .cup-medal-box {
    height: 100%;
    display: flex;
    flex-direction: column;
    .cup-top-box {
      display: flex;
      justify-content: center;
      align-items: flex-end;
      overflow: hidden;
      padding: 10px 0 15px;
      .cup-box {
        display: flex;
        flex-direction: column;
        align-items: center;
        img {
          width: 46px;
          margin-bottom: -6px;
          z-index: 20;
        }
        .top-bg {
          width: 230px;
          height: 0;
          border-bottom: 9px solid rgba(239, 233, 225, 0.39);
          border-left: 20px solid transparent;
          border-right: 10px solid transparent;
        }
        .cup-box-content {
          width: 230px;
          height: 81px;
          background: rgba(245, 241, 234, 0.59);
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          color: #6f89ac;
          p {
            width: 100%;
            margin-bottom: 4px;
            padding: 0 10px;
            text-align: center;
            overflow: hidden;
            text-overflow: ellipsis;
            white-space: nowrap;
          }
        }
      }
      .cup1-box {
        img {
          width: 63px;
        }
        .top-bg {
          width: 260px;
          border-right: 20px solid transparent;
          border-bottom: 9px solid rgba(250, 247, 242, 0.59);
        }
        .cup-box-content {
          width: 260px;
          height: 103px;
          background: rgba(250, 247, 242, 0.59);
          color: #ce7c1f;
        }
      }
      .cup3-box {
        .top-bg {
          border-bottom: 9px solid rgba(245, 241, 234, 0.59);
          border-left: 10px solid transparent;
          border-right: 20px solid transparent;
        }
        .cup-box-content {
          height: 65px;
          background: rgba(245, 241, 234, 0.59);
          color: #8d4112;
        }
      }
    }
  }
  .medal-box {
    display: flex;
    flex-direction: column;
    align-items: center;
    .medal-top-box {
      margin: 60px 0 15px;
      display: flex;
      justify-content: space-between;
      align-items: flex-end;
      min-width: 70%;
      .medal-box {
        width: 160px;
        height: 91px;
        border-radius: 4px;
        border: 1px solid rgba(111, 137, 172, 0.59);
        flex-shrink: 0;
        position: relative;
        .medal-box-content {
          height: 100%;
          width: 100%;
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          color: #6f89ac;
          p {
            width: 100%;
            margin-bottom: 4px;
            padding: 0 10px;
            text-align: center;
            overflow: hidden;
            text-overflow: ellipsis;
            white-space: nowrap;
          }
        }
        img {
          width: 60px;
          margin-top: -30px;
        }
      }
      .medal1-box {
        width: 200px;
        height: 100px;
        margin: 0 10px;
        border: 1px solid rgba(206, 124, 31, 0.59);
        .medal-box-content {
          color: #ce7c1f;
        }
        img {
          width: 100px;
          margin-top: -65px;
        }
      }
      .medal3-box {
        border: 1px solid rgba(141, 65, 18, 0.59);
        .medal-box-content {
          color: #8d4112;
        }
      }
    }
  }
}
>>> .el-table thead tr th {
  background-color: #fff;
}
